import './App.css';
import Contatore from './componente/Contatore';

function App(){
    return <div>
        <p>Componente contatore da 0</p>
        <Contatore count={0} />

        <p>Componente contatore da 100</p>
        <Contatore count={100} />
    </div>
}

export default App;
